import React, { Component } from 'react'

const classes = {
    returnArrow: {
        fontSize: '40px',
        position: 'absolute',
        marginTop: '35%'
    }
}

class LprConfig extends Component{

    state = {
        currentCamera: null
    }

    render(){
        return(
            <div>
                <h1>Configure License Plate Detection Zone</h1>
                <p>Select a camera feed to configure its license plate detection area. Only license plates within the box will be detected</p>
                <a href="/dashboard/configuration" style={{textDecoration: 'none', color: '#000'}}>
                    <span class="material-icons" style={classes.returnArrow}>
                        arrow_back_ios
                    </span>  
                </a>           
            </div>
        )
    }

}

export default LprConfig
